import React from 'react'
import { Route, Routes } from 'react-router-dom'
import Button from './Button'

var adminList=[{'id':'345','fullName':'abel tesfaye','phone':'0912935475','email':'abc@gmail.com','password':'********'}
,{'id':'123','fullName':'yanet biruk','phone':'0912935475','email':'abc@gmail.com','password':'********'}
,{'id':'123','fullName':'girma alem','phone':'0912935475','email':'abc@gmail.com','password':'********'}
,{'id':'123','fullName':'robel tesfaye','phone':'0912935475','email':'abc@gmail.com','password':'********'}
,{'id':'123','fullName':'girum abebe','phone':'0912935475','email':'abc@gmail.com','password':'********'}

]

export default function Admins() {

  return (
    <Routes>
        <Route exact path="/" element={<showAdmins/>} />
        <Route path="/edit/" element={<newAdmin/>} />
        <Route path="/delete/" element={<deleteAdmin/>} />

      </Routes>
        )
}


export function showAdmins() {
  return (
    <div>
      <table className="table table-striped">
                          <thead classNameName=''>
                            <tr>
                                <th>Id</th>
                                <th>Full Name</th>
                                <th>Phone</th>
                                <th>Email</th>
                                <th>Password</th>
                                <th>
                                <Button
                color=""
                bgColor="var(--primary-color)"
                name="Add Admin"
                id="addAdminBtn"
                className="btn px-4"

              />
                                </th>

                            </tr>
                          </thead>
                            <tbody id="tableDataField">

                            {adminList.map((item)=>{
                              return(
                              <tr>
                                <td>{item.id}</td>
                                <td>{item.fullName}</td>
                                <td>{item.phone}</td>
                                <td>{item.email}</td>
                                <td>{item.password}</td>
                                <td>
                                <Button
                                  color=""
                                  bgColor=''
                                  name="Edit"
                                  id={item.id}
                                  className="btn editBtn"

                                />
                                <Button
                                  color=""
                                  bgColor=''
                                  name="Delete"
                                  id={item.id}
                                  className="btn deleteButton btn btn-customized text-center px-5"
                                />
                                </td>
                            </tr>
                              )

                            })}
                            </tbody>

      </table>
      </div>

  )
}

